export function Skills() {
  return (
    <section className="p-8 bg-white" data-aos="fade-up">
      <h2 className="text-4xl font-bold mb-4 text-center border-b-4 border-indigo-500 inline-block">Skills</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 max-w-5xl mx-auto mt-6">
        <div className="bg-indigo-50 p-4 rounded-xl shadow hover:shadow-lg transition"><strong>Technical:</strong><br /> Algorithms, Data Structures, Git, DBMS, AI, ML, Data Science</div>
        <div className="bg-indigo-50 p-4 rounded-xl shadow hover:shadow-lg transition"><strong>Programming:</strong><br /> Python, C, Java, SQL, PHP, JS, HTML, CSS, R</div>
        <div className="bg-indigo-50 p-4 rounded-xl shadow hover:shadow-lg transition"><strong>Soft Skills:</strong><br /> Research, Critical Thinking, Public Speaking</div>
        <div className="bg-indigo-50 p-4 rounded-xl shadow hover:shadow-lg transition"><strong>Languages:</strong><br /> English, Hindi, Urdu</div>
      </div>
    </section>
  );
}
